import React from "react";

const people1 = [
	{ id: 1, name: "chris" },
	{ id: 2, name: "nick" },
];

const people2 = [
	{
		name: "chris",
		pets: [
			{ name: "bella", type: "dog" },
			{ name: "cocoa", type: "dog" },
		],
	},
	{
		name: "nick",
		pets: [
			{ name: "hilo", type: "cat" },
			{ name: "polly", type: "cat" },
		],
	},
];

function App() {
	return <div className="App">
		{
			people1.map((people, index) => {
				return (
					<ul key={index}>{people.name}

					</ul>
				)
			})
		}
	</div>;
}

export default App;
